void initRigidBody(Object* obj)
{
	obj->rigidBody.type = TYPE_SPHERE;
	for (int i = 0; i < 3; i++)
		obj->rigidBody.angluarVel.axis[i] = 0;
	for (int i = 0; i < 3; i++)
		obj->rigidBody.acceleration.axis[i] = 0;
	for (int i = 0; i < 3; i++)
		obj->rigidBody.lineralVel.axis[i] = 0;
	obj->rigidBody.mass = 1;
	obj->rigidBody.alpha = 0;
	obj->rigidBody.theta = 0;
	obj->rigidBody.omega = 0;
	obj->rigidBody.J = 1;
}

void setColor(Object* obj, vec3 color)
{
	for (int i = 0; i < 3; i++)
		obj->color[i] = color[i];
}
void setPosition(Object* obj, vec3 pos)
{
	for (int i = 0; i < 3; i++)
		obj->position[i] = pos[i];
}
void setRotation(Object* obj, vec3 pos)
{
	for (int i = 0; i < 3; i++)
		obj->rotation[i] = pos[i];
}

void setProp(Object* obj, float* vert, int count)
{
	for(int i=0;i<16;i++)
	{
		obj->model[i/4][i%4] = i % 5 == 0?1:0;
	}
	
	setColor(obj, (vec3){1.0f, 0.5f, 0.31f});
	setPosition(obj, (vec3){0, 0, 0});
	setRotation(obj, (vec3){0, 0, 0});
	obj->render = 0;
	obj->vertices = vert;
	obj->vCount = count;
	obj->shader = NULL;
}
