Object* fromStlFile(char* name)
{
	
	FILE * fp = fopen(name, "r");
	if (fp == NULL) return;
	char c;
	int count = 0;

	long length = 0;
	while ((c = getc(fp)) != EOF)
	{
		if (c <= 127)
		{
			length++;
		}
	}
	GLfloat *vert = (GLfloat*)malloc(sizeof(GLfloat)*length);
	
	fseek(fp, 0, SEEK_SET);
	char x[1024];
	/* assumes no word exceeds length of 1023 */
	bool started = false;
	int iterator=0;
	float normal[3];
	float vertex[3];
	int CurSize = 0;
	while (fscanf(fp, " %1023s", x) == 1) {
		if (!started && strcmp(x, "facet") == 0)
		{
			started = true;
			//iterator--;
		}
		if(started)
		{
			if(strcmp(x, "facet") == 0)
			{
				iterator = 0;
			}
			//printf("%s ", x);

			if(iterator == 2)
			{
				sscanf(x, "%f", &(normal[0]));
			}
			else if (iterator == 3)
			{
				sscanf(x, "%f", &(normal[1]));
			}
			else if (iterator == 4)
			{
				sscanf(x, "%f", &(normal[2]));
			}
			else if (iterator == 8 || iterator == 12 || iterator == 16)
			{
				sscanf(x, "%f", &(vertex[0]));
			}
			else if (iterator == 9 || iterator == 13 || iterator == 17)
			{
				sscanf(x, "%f", &(vertex[1]));
			}
			else if (iterator == 10 || iterator == 14 || iterator == 18)
			{
				sscanf(x, "%f", &(vertex[2]));
				vert[CurSize] = vertex[0];
				vert[CurSize+1] = vertex[1];
				vert[CurSize+2] = vertex[2];
				vert[CurSize+3] = normal[0];
				vert[CurSize+4] = normal[1];
				vert[CurSize+5] = normal[2];
				CurSize += 6;
			}
			iterator++;

			if (strcmp(x, "endsolid") == 0)
			{
				break;
			}
		}
	}
	//for(int i=0; i<CurSize;i++)
	//{
	//	printf("%f ", vert[i]);
	//	if (i!=1 && (i+1) % 6 == 0)
	//		printf("\n");
	//}
	fclose(fp);
	//if (name[0] == 'i')
	//{
	//	FILE* fp2 = fopen("sphere.txt", "w+");
	//	for (int i = 0; i < CurSize; i++) {
	//		fprintf(fp, "%f, ", vert[i]);
	//	}
	//	fprintf(fp, "%d, ", CurSize);
	//	fclose(fp);
	//}
	
	Object* obj = (Object*)malloc(sizeof(Object));
	setProp(obj, vert, CurSize / 2);

	glGenVertexArrays(1, &obj->VAO);
	glGenBuffers(1, &obj->VBO);

	glBindBuffer(GL_ARRAY_BUFFER, obj->VBO);
	glBufferData(GL_ARRAY_BUFFER, CurSize*sizeof(float), vert, GL_STATIC_DRAW);

	glBindVertexArray(obj->VAO);
	// Position attribute
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 6 * sizeof(GLfloat), (GLvoid*)0);
	glEnableVertexAttribArray(0);
	// Normal attribute
	glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 6 * sizeof(GLfloat), (GLvoid*)(3 * sizeof(GLfloat)));
	glEnableVertexAttribArray(1);
	glBindVertexArray(0);
	obj->color[0] = 0.4f;
	obj->color[1] = 0.4f;
	obj->color[2] = 0.4f;
	obj->render = &renderObjectStandart;
	initRigidBody(&obj);
	return obj;
}
void setPos(Object* obj, vec3 axis)
{
	glm_translate(obj->model, 
		(vec3) {-obj->position[0],-obj->position[1], -obj->position[2]});

	glm_translate(obj->model,
		(vec3) {
		axis[0], axis[1], axis[2]
	});
	obj->position[0] = axis[0];
	obj->position[1] = axis[1];
	obj->position[2] = axis[2];
}
Object* appendObject(ListObjects* o, Object* obj)
{
	if(o->objects == NULL)
	{
		o->objects = (Object**)malloc(sizeof(Object*));
		o->count = 1;
		o->objects[0] = obj;
	}
	else
	{
		o->objects = (Object**)realloc(o->objects, sizeof(Object*)*(o->count+1));
		o->objects[o->count] = obj;
		o->count++;
	}
	return (o->objects[o->count - 1]);
}
